import React, { useState, useEffect } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "owl.carousel/dist/assets/owl.carousel.css";
import "owl.carousel/dist/assets/owl.theme.default.css";
import "jquery-nice-select/css/nice-select.css";
import "./css/style.css";
import "./css/responsive.css";
import Navbar from "../navbar";

const Menu = () => {
  const [menuItems, setMenuItems] = useState([]);
  const [filter, setFilter] = useState("all");

  // Fetch menu items from a fake API
  useEffect(() => {
    const fetchMenuItems = async () => {
      try {
        const response = await fetch(
          "https://mocki.io/v1/9a6a5b20-b0b3-4a8c-97d6-2b6da8f32c94"
        ); // Replace with your mock API URL
        const data = await response.json();
        setMenuItems(data);
      } catch (error) {
        console.error("Error fetching menu items:", error);
      }
    };

    fetchMenuItems();
  }, []);

  // Filtered menu items
  const filteredItems =
    filter === "all"
      ? menuItems
      : menuItems.filter((item) => item.category === filter);

  return (
    <div className="sub_page">
      <Navbar />

      {/* Food Section */}
      <section className="food_section layout_padding">
        <div className="container">
          <div className="heading_container heading_center">
            <h2>Our Menu</h2>
          </div>
          <ul className="filters_menu">
            {["all", "burger", "pizza", "pasta", "fries"].map((category) => (
              <li
                key={category}
                className={filter === category ? "active" : ""}
                onClick={() => setFilter(category)}
              >
                {category.charAt(0).toUpperCase() + category.slice(1)}
              </li>
            ))}
          </ul>
          <div className="filters-content">
            <div className="row grid">
              {filteredItems.map((item) => (
                <div
                  key={item.id}
                  className={`col-sm-6 col-lg-4 all ${item.category}`}
                >
                  <div className="box">
                    <div>
                      <div className="img-box">
                        <img src={item.image} alt={item.name} />
                      </div>
                      <div className="detail-box">
                        <h5>{item.name}</h5>
                        <p>{item.description}</p>
                        <div className="options">
                          <h6>{item.price}</h6>
                          <a href="#">
                            <i className="fa fa-shopping-cart"></i>
                          </a>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
          <div className="btn-box">
            <a href="/">View More</a>
          </div>
        </div>
      </section>
      {/* End Food Section */}

      {/* Footer Section */}
      <footer className="footer_section">
        <div className="container">
          <div className="row">
            <div className="col-md-4 footer-col">
              <div className="footer_contact">
                <h4>Contact Us</h4>
                <div className="contact_link_box">
                  <a href="/">
                    <i className="fa fa-map-marker" aria-hidden="true"></i>
                    <span>Location</span>
                  </a>
                  <a href="/">
                    <i className="fa fa-phone" aria-hidden="true"></i>
                    <span>Call +01 1234567890</span>
                  </a>
                  <a href="/">
                    <i className="fa fa-envelope" aria-hidden="true"></i>
                    <span>demo@gmail.com</span>
                  </a>
                </div>
              </div>
            </div>
            <div className="col-md-4 footer-col">
              <div className="footer_detail">
                <a href="/" className="footer-logo">
                  Feane
                </a>
                <p>
                  Necessary, making this the first true generator on the
                  Internet. It uses a dictionary of over 200 Latin words,
                  combined with
                </p>
                <div className="footer_social">
                  <a href="/">
                    <i className="fa fa-facebook" aria-hidden="true"></i>
                  </a>
                  <a href="/">
                    <i className="fa fa-twitter" aria-hidden="true"></i>
                  </a>
                  <a href="/">
                    <i className="fa fa-linkedin" aria-hidden="true"></i>
                  </a>
                  <a href="/">
                    <i className="fa fa-instagram" aria-hidden="true"></i>
                  </a>
                  <a href="/">
                    <i className="fa fa-pinterest" aria-hidden="true"></i>
                  </a>
                </div>
              </div>
            </div>
            <div className="col-md-4 footer-col">
              <h4>Opening Hours</h4>
              <p>Everyday</p>
              <p>10.00 Am -10.00 Pm</p>
            </div>
          </div>
          <div className="footer-info">
            <p>
              &copy; <span id="displayYear"></span> All Rights Reserved By
              <a href="https://html.design/">Free Html Templates</a>
              <br />
              &copy; <span id="displayYear"></span> Distributed By
              <a
                href="https://themewagon.com/"
                target="_blank"
                rel="noreferrer"
              >
                ThemeWagon
              </a>
            </p>
          </div>
        </div>
      </footer>
    </div>
  );
};

export default Menu;
